import React from 'react';
import Linechart1 from "./linechart1"
class Exposuretrends extends React.Component{
    constructor(){
        super()
    }

render(){
    return(
        <div className="et">
            <div className="et1">
            <p> Cyber Exposure Score</p>
            </div>
            <div className="et2">
                <Linechart1/>
            </div>
        <style jsx>
            {`
            .et{
                display:flex;
                flex-direction:column;
                
                height:100%;
                width:100%;
                background:pink;
                
            }
            .et1{
                display:flex;
                width:100%;
                height:16%;
                background:yellow;
                justify-content:flex-center;
                align-items:flex-center;
                display:flex;
                align-items:flex-start;
                justify-content:center;
                
                font-size:20px;
                height:10%;
                over-flow:auto;
                
            }
            .et2{
                overflow: hidden;
            }

            `}
        </style>
        
        </div>
    )
}
}
export default Exposuretrends;
